const ImageGridListStyle = {
	root: {
		display: 'flex',
		flexWrap: 'wrap',
		justifyContent: 'space-around',
		overflow: 'hidden',
		backgroundColor: "black",
	},
	gridList: {
		'&::after': {
			width: "66.6667% !important",
			height: "auto !important"
		}
	},
};

export default ImageGridListStyle;
